// Define your parameters\nSqlParameter p1 = new SqlParameter("@Param1", SqlDbType.Int) { Value = 1 };\nSqlParameter p2 = new SqlParameter("@Param2", SqlDbType.VarChar) { Value = "value2" };\nSqlParameter p3 = new SqlParameter("@Param3", SqlDbType.DateTime) { Value = DateTime.Now };\nSqlParameter p4 = new SqlParameter("@Param4", SqlDbType.Bit) { Value = true };\nSqlParameter p5 = new SqlParameter("@Param5", SqlDbType.Decimal) { Value = 123.45M };\n\n// Add parameters to an array\nSqlParameter[] parameters = new SqlParameter[] { p1, p2, p3, p4, p5 };\n\n// Call the method with the procedure name and parameters\nSqlCommand cmd = getCommand("YourStoredProcedureName", parameters);